import React from "react";
import { CSSTransition } from "react-transition-group";
import "./About.styles.css";

function About() {

  return (
    <>
      <div className="about-title">
        <p>
          Half developer,
          <br /> half designer,
          <br /> full creative
        </p>
      </div>
    </>
  );
}

export default About;
